    { title: '', dataIndex: ['metrics','servedCustomers'], key: 'servedCustomers' },
    { title: '', dataIndex: ['metrics','resolvedIssues'], key: 'resolvedIssues' },
    { title: '', key: 'escalationRate', render: (_: any, r: any) => `${Math.round(r.metrics.escalationRate*100)}%` },
    { title: '', key: 'channels', render: (_: any, r: any) => r.deployedChannels.map((c: string) => <Tag key={c}>{c}</Tag>) },
    { title: '', key: 'actions', render: (_: any, r: any) => (
        <Space size="small">
          <Button size="small" onClick={() => navigate(`/ai-tools/consultant/${r.id}/edit`)}></Button>
