    { label: 'wecom', value: 'wecom' },
    { label: 'lark', value: 'lark' },
  ];
  return (
    <div style={{ 
      padding: '24px',
      background: '#fafafa',
      minHeight: 'calc(100vh - 120px)'
    }}>
      <div style={{ 
        maxWidth: '1400px', 
        margin: '0 auto'
      }}>
        {/*  /  /  /  */}
        <div style={{ 
          display: 'flex', 
          justifyContent: 'space-between', 
          alignItems: 'center', 
          marginBottom: '24px'
        }}>
          <Space size="middle" wrap>
            <Input 
              allowClear 
              placeholder="/" 
              value={searchText}
              onChange={(e) => setSearchText(e.target.value)}
              style={{ width: 220 }}
              size="middle"
            />
            <Select
              allowClear
              placeholder=""
              value={channelFilter as any}
              onChange={(v) => setChannelFilter(v)}
              options={channelOptions as any}
              style={{ width: 180 }}
              size="middle"
            />
          </Space>

          <Space size="small">
            <Button 
              icon={<AppstoreOutlined />} 
              type={viewMode==='card' ? 'primary' : 'default'}
              size="middle"
              onClick={() => setViewMode('card')}
            />
            <Button 
              icon={<UnorderedListOutlined />} 
              type={viewMode==='list' ? 'primary' : 'default'}
              size="middle"
              onClick={() => setViewMode('list')}
            />
            <Button 
              type="primary" 
              icon={<PlusOutlined />}
              size="middle"
              onClick={handleCreateAgent}
              style={{ borderRadius: '6px', fontWeight: '500' }}
            ></Button>
          </Space>
        </div>

        {viewMode === 'card' ? (
          <Row gutter={[16, 16]}>
            {filteredAgents.map((agent) => (
              <Col key={agent.id} xs={24} sm={12} md={8} lg={6} xl={6}>
                <AgentCard agent={agent} />
              </Col>
            ))}
          </Row>
        ) : (
          <Table
            rowKey="id"
            size="small"
            pagination={{ pageSize: 8 }}
            dataSource={filteredAgents}
            columns={listColumns as any}
            style={{ background: '#fff', borderRadius: 8 }}
          />
        )}

        {/*  */}
        {mockAgents.length === 0 && (
          <div style={{ 
            textAlign: 'center', 
            padding: '80px 20px',
            color: '#999'
          }}>
            <div style={{ fontSize: '64px', marginBottom: '24px' }}></div>
            <Title level={3} style={{ color: '#666', marginBottom: '16px' }}>

            </Title>
            <p style={{ fontSize: '16px', color: '#999', marginBottom: '32px' }}>
              ""AI
            </p>
            <Button 
              type="primary" 
              icon={<PlusOutlined />}
              onClick={handleCreateAgent}
              size="large"
              style={{ 
                height: '48px',
                borderRadius: '6px',
                fontWeight: '500'
              }}
            >

            </Button>
          </div>
        )}
      </div>
    </div>
  );
};

export default AgentsPage;

